Nothing like a rainy day to make you appreciate the sunshine. After two dives earlier in the day we took a couple boats to Batu Pensil, which means “pencil rock”. It’s a group of rock formations coming sharply out of the ocean and topped with trees. Every day in Indonesia I’m seeing things I’ve never seen in my life.

Have any of you been to Indonesia? Any recommendations?

@indtravel #tripofwonders #wonderfulindonesia #indonesia

Advice for photographers. Go shoot something new. Quit doing the same things over and over and over. It gets boring and you stop growing. Go take on a project that scares you, one that forces you to think critically again like the first time you picked up a camera. It was a pleasure to shoot this project in Indonesia. Both underwater and wildlife photography are crazy difficult and I had the time of my life working on it.

Shot this while playing with the stingless jellies at Kakaban Lake. Check out the location for more cool shots of these rare jellies.

